import React from "react";
import "./footer.css";
import { FaInstagram, FaGithub, FaLinkedin } from "react-icons/fa";

function Footer() {
  return (
    <div className="footer">
      <p className="copyright">Onur Yıldırım 2022</p>
      <div className="footer-links">
      <a href="/">
            <FaInstagram />
          </a>
        <FaGithub />
        <FaLinkedin />
      </div>
    </div>
  );
}

export default Footer;
